import React from "react";
import { Routes, Route } from "react-router-dom";
import HeaderUser from "../general/HeaderUser";
import WebsiteFooter from "../general/WebsiteFooter";
import PageContents from "./PageContents";
import ViewTrainingOpportunities from "../Homepage/ViewTrainingOpportunities";
import SearchForOpportunity from "./StudentPages/SearchForOpportunity";

const Homepage = () => {
  return (
    <>
      <Routes>
        <Route
          path="/"
          element={
            <>
              <HeaderUser />
              <PageContents />
              <ViewTrainingOpportunities />
              <WebsiteFooter />
            </>
          }
        />
        <Route path="/Profile/" element={<SearchForOpportunity />} />
        <Route path="/AddSupervisor/" element={<SearchForOpportunity />} />
        <Route path="/SearchForOpp/" element={<SearchForOpportunity />} />
        <Route path="/CurrentTraining/" element={<SearchForOpportunity />} />
        <Route path="/FillForms/" element={<SearchForOpportunity />} />
        <Route path="/CurrentTraining/" element={<SearchForOpportunity />} />
        <Route path="/SignOut/" element={<SearchForOpportunity />} />
      </Routes>
    </>
  );EvaluateOpportunity
};

export default Homepage;
